/* Model creation/destruction functions */

void MODEL_mkFSM::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkFSM_instance = new MOD_mkFSM(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkFSM_instance->INST_start_wire.set_clk_0)("CLK");
  (mkFSM_instance->INST_start_reg_2.set_clk_0)("CLK");
  (mkFSM_instance->INST_abort.set_clk_0)("CLK");
  (mkFSM_instance->INST_state_set_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_state_overlap_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_state_fired_1.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_running.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_start_wire.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_start_reg_1.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_abort.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_state_set_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_state_overlap_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_state_fired_1.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_start_wire.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_start_reg_1.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_abort.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_state_set_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_state_overlap_pw.set_clk_0)("CLK");
  (mkFSM_instance->INST_par_blocks_1_state_fired_1.set_clk_0)("CLK");
  (mkFSM_instance->set_clk_0)("CLK");
}
void MODEL_mkFSM::destroy_model()
{
  delete mkFSM_instance;
  mkFSM_instance = NULL;
}
void MODEL_mkFSM::reset_model(bool asserted)
{
  (mkFSM_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkFSM::get_instance()
{
  return mkFSM_instance;
}

/* Fill in version numbers */
void MODEL_mkFSM::get_version(char const **name, char const **build)
{
  *name = "2023.07";
  *build = "0eb551dc";
}

/* Get the model creation time */
time_t MODEL_mkFSM::get_creation_time()
{
  
  /* Mon Jan 15 20:45:36 UTC 2024 */
  return 1705351536llu;
}

/* State dumping function */
void MODEL_mkFSM::dump_state()
{
  (mkFSM_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkFSM & mkFSM_backing(tSimStateHdl simHdl)
{
  static MOD_mkFSM *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkFSM(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkFSM::dump_VCD_defs()
{
  (mkFSM_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkFSM::dump_VCD(tVCDDumpType dt)
{
  (mkFSM_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkFSM_backing(sim_hdl));
}
